import { getRateJp } from "../rate";
import { instance } from "../services"

export const getSalesHistorySNKRDUNK = async (submitCode) => {
    const response = await instance.get(`https://snkrdunk.com/v1/products/${submitCode}/sales-history?size_id?&page=1&per_page=20`)
    const rate = await getRateJp();
    const data = response.data.history;
    const arr = [];
    console.log(submitCode)
    for (let i = 0; i < 20; i++) {
        arr.push(
            {
                size: pa(data[i].size),
                price: Math.floor(data[i].price*rate),
                date: data[i].date
            }
        )
    }
    return arr
}
